import * as rxjs from 'rxjs';

export default class PubSubService {
  constructor() {
    this.subject = new rxjs.Subject();
  }

  emit(value) {
    this.subject.next(value);
  }

  greetings() {
    return this.subject.asObservable();
  }
}
